import pandas as pd
import json
import matplotlib.pyplot as plt
import numpy as np
import os


def load_menu_data(path):
    """
    load menu data with csv format
    :param path:
    :return:
    """
    csv_data = pd.read_csv(path, error_bad_lines=False)
    return csv_data


def load_recipe_data(path):
    """
    load recipe data with json format
    :param path:
    :return:
    """
    with open(path, encoding='utf-8') as f:
        json_data = json.load(f)
    return json_data


def text_search(source, target):
    """
    Given a source str, search the most matched string in the target set
    :param source: a source string
    :param target: a string iterable set
    :return:
    """
    matched_idx = -1
    matched_text = ""
    matched_len = 0
    matched_target = ""
    matched_percentage = 0
    for i, target_text in enumerate(target):
        temp_matched_len, temp_matched_text = find_lcsubstr(source, target_text['name'])
        temp_percentage = (temp_matched_len / len(source) + temp_matched_len / len(target_text['name'])) / 2
        #if temp_matched_len > matched_len:
        if temp_percentage > matched_percentage:
            matched_percentage = temp_percentage
            matched_len = temp_matched_len
            matched_text = temp_matched_text
            matched_idx = i
            matched_target = target_text['name']
    return matched_idx, matched_text, matched_len, matched_target


def find_lcsubstr(s1, s2):
    """
    find longest substring between two string
    :param s1:
    :param s2:
    :return:
    """
    m = [[0 for i in range(len(s2) + 1)] for j in range(len(s1) + 1)]  # 生成0矩阵，为方便后续计算，比字符串长度多了一列
    mmax = 0  # 最长匹配的长度
    p = 0  # 最长匹配对应在s1中的最后一位
    for i in range(len(s1)):
        for j in range(len(s2)):
            if s1[i] == s2[j]:
                m[i + 1][j + 1] = m[i][j] + 1
                if m[i + 1][j + 1] > mmax:
                    mmax = m[i + 1][j + 1]
                    p = i + 1
    return mmax, s1[p - mmax:p]


def auto_label(labels, bins):
    """
    Attach a text label above each bar displaying its height
    """
    print(labels)
    for i, v in enumerate(labels):
        plt.text(bins[i] + 0.015,
                 labels[i] + 2,
                 # v / labels[i] + 100,
                 "{:d}".format(int(labels[i])),
                 fontsize=12)


def draw_hist(data):
    """
    draw hist with data
    :param data:
    """
    n, bins, patches = plt.hist(x=data, bins='auto', color='#0504aa',
                                alpha=0.7, rwidth=0.85)
    plt.grid(axis='y', alpha=0.75)
    plt.xticks()
    plt.xlabel('Value')
    plt.ylabel('Frequency')
    plt.title('Histogram')
    plt.text(23, 45, r'$\mu=15, b=3$')
    maxfreq = n.max()
    # 设置y轴的上限
    plt.ylim(ymax=np.ceil(maxfreq / 10) * 10 if maxfreq % 10 else maxfreq + 10)
    auto_label(n, bins)
    plt.savefig('Histogram')
    plt.show()


def merger_all_json(path):
    """
    merge all json on the path
    :param path:
    :return:
    """
    json_data = []
    for root, dirs, files in os.walk(path):
        for f in files:
            if os.path.splitext(f)[-1] == '.json':
                print("loading form {}".format(root + f))
                try:
                    with open(os.path.join(root, f), encoding='utf-8') as json_f:
                        tmp_recipe_data = json.load(json_f)
                    json_data.extend(tmp_recipe_data)
                except Exception as e:
                    print(e)
                    continue
    return json_data


def main():
    """
    main function
    """
    menu_path = './sources/sample_menu.csv'
    menu_data = load_menu_data(menu_path)

    recipe_path = './meishiji/meishiji'
    recipe_data = merger_all_json(recipe_path)

    #recipe_path = './sources/recipe.json'
    #recipe_data = load_recipe_data(recipe_path)
    print("length of recipes: {}".format(len(recipe_data)))

    record_file = open('match_record.csv', 'w')
    error_file = open('error_menu.txt', 'w')
    matched_result = []
    matched_weighted_result = []

    for menu_idx, menu in menu_data.iterrows():
        if menu_idx % 20 == 0:
            print(menu_idx)
        try:
            # for some menu are wrong
            matched_idx, matched_text, matched_len, matched_target = text_search(menu['name'], recipe_data)
            matched_result.append(matched_len/ len(menu['name']))
            matched_weighted_result.append((matched_len / len(menu['name']) + matched_len / len(matched_target)) / 2)
            record_file.write("{}\t{}\t{}\t{:.2%}\t{:.2%}\n".format(
                menu['name'],
                matched_text,
                matched_target,
                matched_len / len(menu['name']),
                (matched_len / len(menu['name']) + matched_len / len(matched_target)) / 2
            ))
            record_file.flush()
        except Exception as e:
            print(e)
            error_file.write(str(menu_idx) + '\n')
            continue

    # draw hist
    print(matched_result)
    draw_hist(matched_result)
    print(matched_weighted_result)
    draw_hist(matched_weighted_result)


